import React, { Component } from 'react';
import Customer from './components/Customer'
import './App.css';

const customers = [{
    'id': 1,
    'image': 'https://placeimg.com/64/64/any',
    'name': '추상우',
    'birthday': '961222',
    'gender': '남자',
    'job': '대학생'
    },
    {
    'id': 2,
    'image': 'https://placeimg.com/64/64/any',
    'name': '장재영',
    'birthday': '941029',
    'gender': '남자',
    'job': '디자이너'
    },
    {
      'id': 3,
      'image': 'https://placeimg.com/64/64/any',
      'name': '무정후',
      'birthday': '990527',
      'gender': '남자',
      'job': '이사님ㅎ'
      }
]

class App extends Component {
render() {
  return (
   <div>
     {customers.map(c=>{
       return <Customer key={c.id} image={c.image} name={c.name} gender={c.gender} birthday={c.birthday} job={c.job}/>
     })}
   </div>
    );
  }
}

export default App;
